def OEAddLicenseFromHttp(url):
    """Retrieve a presumably valid license from url and add its permissions to the licensing system.
       Only HTTP and HTTPS protocols are supported.  Query parameters in url are ignored."""

    import sys
    if sys.version_info[0] >= 3:
        import http.client as httplib
        from urllib.parse import urlparse
    else:
        import httplib
        from urlparse import urlparse

    if not url:
        raise Exception("URL can't be None and must not be empty")

    parts = urlparse(url)
    conn = None
    try:
        if parts.scheme == "http":
            conn = httplib.HTTPConnection(parts.netloc, timeout=10)
        elif parts.scheme == "https":
            conn = httplib.HTTPSConnection(parts.netloc, timeout=10)
        else:
            raise Exception("Invalid url scheme: " + parts.scheme)

        conn.request("GET", parts.path)
        response = conn.getresponse()
        if response.status != httplib.OK:
           raise Exception("Can't download license: server response status: %d %s" % (response.status, response.reason))

        ctype = response.getheader("Content-type")
        if ctype not in ["text/plain", "text/html; charset=utf-8", "text/plain; charset=utf-8"]:
            raise Exception("Invalid Content-type encoding: " + ctype)

        licenseContent = response.read()
        if sys.version_info[0] >= 3:
            licenseContent = licenseContent.decode("UTF-8")
        OEAddLicenseData(licenseContent)
    finally:
        if conn:
            conn.close()


