def OEGetLazyIterCls(baseclass):
    class OETestLazyIterator(baseclass):
        """
        This class wraps around an OpenEye iterator to force an object copy
        during iteration.
        """
        def __init__(self, iter=None):
            if iter is not None:
                baseclass.__init__(self, iter)
            else:
                baseclass.__init__(self)

        def __iter__(self):
#the iterator is lazy so yield a copy instead
            for obj in baseclass.__iter__(self):
                copy = obj.__class__(obj)
                yield copy

        def next(self):
            try:
                obj = self.Target()
            except IndexError:
                raise StopIteration("Attempting to get past end of OELazyIterator")
            self.Next()
            return obj

        def prev(self):
            try:
                obj = self.Target()
            except IndexError:
                raise StopIteration("Attempting to get past beginning of OELazyIterator")
            self.Prev()
            return obj

        def Copy(self):
            return self.__class__(self)

        def Target(self):
            obj = baseclass.Target(self)
            return obj.__class__(obj)

    return OETestLazyIterator

