def IsPythonCommandlineInterpreter():
    import sys
    if sys.flags.interactive:
        return True

    import os
    if "PYTHONINSPECT" in os.environ:
        return True

    import __main__
    if (not hasattr(__main__, "__file__") and
        sys.argv and sys.argv[0] != "-c"):
        return True

    return False

def TextModeStdin():
    import os
    import msvcrt
    STDIN_FILENO = 0
    msvcrt.setmode(STDIN_FILENO, os.O_TEXT)

import sys
if sys.platform.startswith("win"):
    if IsPythonCommandlineInterpreter():
        TextModeStdin()

del sys

